import React from 'react'

function BookShelf(p, bookShelfImg, posX, posY) {
    p.pop()
    this.pos = p.createVector(p.width/2, p.height/2)
    p.push()
    this.render = function () {
    p.pop()
        p.image(bookShelfImg, this.pos.x, this.pos.y)
    p.push()
    }
}

export default BookShelf
